BEGIN TRANSACTION;
DROP TABLE IF EXISTS "comment_result";
DROP TABLE IF EXISTS "comments";
DROP TABLE IF EXISTS "results";
DROP TABLE IF EXISTS "evaluation_teacher";
DROP TABLE IF EXISTS "evaluations";
DROP TABLE IF EXISTS "parameters";
DROP TABLE IF EXISTS "group_student";
DROP TABLE IF EXISTS "groups";
DROP TABLE IF EXISTS "course_semester";
DROP TABLE IF EXISTS "semesters";
DROP TABLE IF EXISTS "students";
DROP TABLE IF EXISTS "teachers";
DROP TABLE IF EXISTS "courses";
DROP TABLE IF EXISTS "departments";
DROP TABLE IF EXISTS "schools";
DROP TABLE IF EXISTS "users";
CREATE TABLE IF NOT EXISTS "users" (
	"id"	INTEGER NOT NULL,
	"name"	varchar(255) DEFAULT NULL,
	"email"	varchar(191) NOT NULL,
	"email_verified_at"	timestamp NULL,
	"password"	varchar(255) NOT NULL,
	"role"	int NOT NULL DEFAULT '1',
	"remember_token"	varchar(100) DEFAULT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "schools" (
	"id"	INTEGER NOT NULL,
	"name"	varchar(255) NOT NULL,
	"abbr"	varchar(255) NOT NULL,
	"slug"	varchar(255) NOT NULL,
	"address"	varchar(255) DEFAULT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "departments" (
	"id"	INTEGER NOT NULL,
	"code"	varchar(255) NOT NULL,
	"name"	varchar(255) NOT NULL,
	"abbr"	varchar(255) NOT NULL,
	"slug"	varchar(255) NOT NULL,
	"school_id"	INTEGER NOT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("school_id") REFERENCES "schools"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "courses" (
	"id"	INTEGER NOT NULL,
	"code"	varchar(255) NOT NULL,
	"title"	varchar(255) NOT NULL,
	"abbr"	varchar(255) NOT NULL,
	"slug"	varchar(255) NOT NULL,
	"department_id"	INTEGER NOT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("department_id") REFERENCES "departments"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "teachers" (
	"id"	INTEGER NOT NULL,
	"code"	varchar(255) NOT NULL,
	"first_name"	varchar(255) NOT NULL,
	"last_name"	NUMERIC NOT NULL,
	"slug"	varchar(255) NOT NULL,
	"address"	varchar(255) NOT NULL,
	"user_id"	INTEGER NOT NULL,
	"department_id"	INTEGER NOT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("department_id") REFERENCES "departments"("id") ON DELETE CASCADE,
	FOREIGN KEY("user_id") REFERENCES "users"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "students" (
	"id"	integer NOT NULL,
	"code"	varchar(255) NOT NULL CHECK("code" REGEXP '^[a-z][0-9]{7}$'),
	"first_name"	varchar(255) NOT NULL,
	"last_name"	varchar(255) NOT NULL,
	"slug"	varchar(255) NOT NULL,
	"address"	varchar(255) NOT NULL,
	"user_id"	INTEGER NOT NULL,
	"department_id"	INTEGER NOT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("user_id") REFERENCES "users"("id") ON DELETE CASCADE,
	FOREIGN KEY("department_id") REFERENCES "departments"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "semesters" (
	"id"	INTEGER NOT NULL,
	"year"	int UNSIGNED NOT NULL,
	"label"	varchar(255) NOT NULL,
	"abbr"	varchar(255) NOT NULL,
	"school_id"	INTEGER NOT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("school_id") REFERENCES "schools"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "course_semester" (
	"id"	INTEGER NOT NULL,
	"course_id"	INTEGER NOT NULL,
	"semester_id"	INTEGER NOT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("course_id") REFERENCES "courses"("id") ON DELETE CASCADE,
	FOREIGN KEY("semester_id") REFERENCES "semesters"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "groups" (
	"id"	INTEGER NOT NULL,
	"number"	int UNSIGNED NOT NULL,
	"schedule"	varchar(255) NOT NULL,
	"teacher_id"	INTEGER DEFAULT NULL,
	"course_semester_id"	INTEGER NOT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("teacher_id") REFERENCES "teachers"("id") ON DELETE CASCADE,
	FOREIGN KEY("course_semester_id") REFERENCES "course_semester"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "group_student" (
	"id"	INTEGER NOT NULL,
	"group_id"	INTEGER NOT NULL,
	"student_id"	INTEGER NOT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("group_id") REFERENCES "groups"("id") ON DELETE CASCADE,
	FOREIGN KEY("student_id") REFERENCES "students"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "parameters" (
	"id"	INTEGER NOT NULL,
	"parent_id"	INTEGER DEFAULT NULL,
	"wording"	varchar(255) NOT NULL,
	"description"	text NOT NULL,
	"uuid"	varchar(255) NOT NULL,
	"helpers"	varchar(255) NOT NULL DEFAULT '',
	"value"	decimal(8, 2) DEFAULT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("parent_id") REFERENCES "parameters"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "evaluations" (
	"id"	INTEGER NOT NULL,
	"title"	varchar(255) NOT NULL,
	"description"	text,
	"course_id"	INTEGER DEFAULT NULL,
	"teacher_id"	INTEGER DEFAULT NULL,
	"parameter_id"	INTEGER DEFAULT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("course_id") REFERENCES "courses"("id") ON DELETE CASCADE,
	FOREIGN KEY("teacher_id") REFERENCES "teachers"("id") ON DELETE SET NULL,
	FOREIGN KEY("parameter_id") REFERENCES "parameters"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "evaluation_teacher" (
	"id"	INTEGER NOT NULL,
	"evaluation_id"	INTEGER NOT NULL,
	"teacher_id"	INTEGER NOT NULL,
	"role"	int NOT NULL DEFAULT '1',
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("evaluation_id") REFERENCES "evaluations"("id") ON DELETE CASCADE,
	FOREIGN KEY("teacher_id") REFERENCES "teachers"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "results" (
	"id"	INTEGER NOT NULL,
	"parameter_id"	INTEGER NOT NULL,
	"student_id"	INTEGER NOT NULL,
	"value"	decimal(8, 2) DEFAULT NULL,
	"helpers"	varchar(255) DEFAULT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("parameter_id") REFERENCES "parameters"("id") ON DELETE SET NULL,
	FOREIGN KEY("student_id") REFERENCES "students"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "comments" (
	"id"	INTEGER NOT NULL,
	"wording"	varchar(255) NOT NULL,
	"abbr"	varchar(255) DEFAULT NULL,
	"details"	text,
	"parameter_id"	INTEGER NOT NULL,
	"value"	decimal(8, 2) DEFAULT NULL,
	"relative"	tinyint(1) NOT NULL DEFAULT '1',
	"proportional"	tinyint(1) NOT NULL DEFAULT '0',
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("parameter_id") REFERENCES "parameters"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "comment_result" (
	"id"	INTEGER NOT NULL,
	"comment_id"	INTEGER NOT NULL,
	"result_id"	INTEGER NOT NULL,
	"special_value"	decimal(8, 2) DEFAULT NULL,
	"created_at"	timestamp DEFAULT current_timestamp,
	"updated_at"	timestamp DEFAULT current_timestamp,
	FOREIGN KEY("result_id") REFERENCES "results"("id") ON DELETE CASCADE,
	FOREIGN KEY("comment_id") REFERENCES "comments"("id") ON DELETE CASCADE,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP INDEX IF EXISTS "comment_result_primary_key";
CREATE UNIQUE INDEX IF NOT EXISTS "primary_key" ON "comment_result" (
	"comment_id",
	"result_id"
);
DROP INDEX IF EXISTS "evaluation_teacher_primary_key";
CREATE UNIQUE INDEX IF NOT EXISTS "primary_key" ON "evaluation_teacher" (
	"evaluation_id",
	"teacher_id"
);
DROP INDEX IF EXISTS "group_student_primary_key";
CREATE UNIQUE INDEX IF NOT EXISTS "primary_key" ON "group_student" (
	"group_id",
	"student_id"
);
DROP INDEX IF EXISTS "course_semester_primary_key";
CREATE UNIQUE INDEX IF NOT EXISTS "course_semester_primary_key" ON "course_semester" (
	"course_id",
	"semester_id"
);
